INSERT INTO pod VALUES (6, 'Glebe - Cafe Church', 'Sydney 2037 NSW', 'in the car park at Cafe Church at 37 St Johns Road (corner Colbourne Avenue) Glebe. This car park has been provided by Cafe Church - see www.cafechurch.org.au for more information about these fine people!  NOTE: Cars regularly move in and out of this location, as it is the GoGet headquarters. We use this as a base for cars waiting on permits, new locations, or when they are back from repairs. If we do have to move a car, we give as much notice as possible and find you a car nearby, but please note that the car type may change. <br><br>
INSERT INTO pod VALUES (8, 'Newtown - Wilson Street Car Park', 'Sydney 2042 NSW', 'in the car park on Wilson Street about 50 metres down from the corner of Erskineville Road. The cars are in bays 6 or 7, next to the disabled parking spot. The car park is close to the Newtown Mission Church and behind ''Happy Chef'' and ''Gelatissimo'' - the best gelati shop in Australia, if not the world. 
